import React from "react";
import { Drawer, Form, InputNumber } from "antd";
const ReservationDrawer = ({ visible, onClose }) => {
  return (
    <Drawer
      title="Reserv place"
      visible={visible}
      closable={false}
      placement="bottom"
    >
      <Form hideRequiredMark>
        <Form.Item
          label="Table_number"
          name="table_number"
          rules={[{ required: true, message: "Enter tabel Number" }]}
        >
          <InputNumber className="w-100" />
        </Form.Item>
      </Form>
    </Drawer>
  );
};

export default ReservationDrawer;
